class Solution(object):
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        def explore(s,r,c):
        	if r<0 or r>len(board)-1 or c<0 or c>len(board[0])-1:
        		return [],True
        	visit[r][c]=1
        	if board[r][c]=='X' or (r,c) in s:
        		return [],False
        	s.append((r,c))
        	u,up=explore(s,r-1,c)
        	d,down=explore(s,r+1,c)
        	l,left=explore(s,r,c-1)
        	ri,right=explore(s,r,c+1)
        	if up or down or left or right:
        		return [], True
        	return [(r,c)]+u+d+l+ri,False

        visit=[[0 if board[__][_]=='O' else 1 for _ in xrange(len(board[0]))] for __ in xrange(len(board))]
        for r in xrange(len(board)):
        	for c in xrange(len(board[0])):
        		if visit[r][c]==1:
        			continue
        		stack,escape=explore([],r,c)
        		if not escape:
        			while stack:
        				x=stack.pop()
        				board[x[0]][x[1]]='X'

    def solve2(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        def explore(r,c):
        	if r<0 or r>len(board)-1 or c<0 or c>len(board[0])-1:
        		return False
        	if board[r][c]=='X' or visit[r][c]==1:
        		return True
        	visit[r][c]=1
        	up=explore(r-1,c)
        	down=explore(r+1,c)
        	left=explore(r,c-1)
        	right=explore(r,c+1)
        	if up and down and left and right:
        		board[r][c]='X'
        		return True
        	return False

        visit=[[0 if board[__][_]=='O' else 1 for _ in xrange(len(board[0]))] for __ in xrange(len(board))]
        for r in xrange(len(board)):
        	for c in xrange(len(board[0])):
        		if visit[r][c]==1:
        			continue
        		explore(r,c)
